import Stack from '@material-ui/core/Stack';
import background from "../../resources/images/brot3.png";

function StudentViewPage() {

    return (
        <div style={{ backgroundImage: `url(${background})` }}>
            <Stack spacing={10} style={{ padding: 0 }}>
                <h1 style={{ textAlign: "center" }}>Item 1</h1>
                <h1 style={{ textAlign: "center" }}>Item 2</h1>
                <h1 style={{ textAlign: "center" }}>Item 3</h1>
                <h1 style={{ textAlign: "center" }}>Item 4</h1>
            </Stack>
        </div>

    )
}

export default StudentViewPage;
